Create an aggregate list of values and number of occurrences in MongoDB<p>Given the following documents:</p>
<pre><code>[
  {
    _id: &quot;N0001&quot;,
    name: &quot;Bruce Lee&quot;,
    skills: [&quot;karate&quot;, &quot;jiu jitsu&quot;],
  },
  {
    _id: &quot;N0002&quot;,
    name: &quot;Bruce Dee&quot;,
    skills: [&quot;karate&quot;, &quot;tae kwon do&quot;],
  },
  {
    _id: &quot;N0003&quot;,
    name: &quot;Bruce See&quot;,
    skills: [&quot;aikido&quot;, &quot;jiu jitsu&quot;],
  },
  {
    _id: &quot;N0004&quot;,
    name: &quot;Deuce Lee&quot;,
    skills: [&quot;karate&quot;, &quot;judo&quot;],
  },
]
</code></pre>
<p>I would like to get the following:</p>
<pre><code>{
  karate: 3,
  jiu jitsu: 2,
  tae kwon do: 1,
  judo: 1,
  aikido: 1,
}
</code></pre>
<p>Now I could get the above with some sort of script like the following:</p>
<pre><code>const uniqueSkills = db.fighters.distinct('skills');
console.log(
  Object.fromEntries(
    uniqueSkills.map(
      async m =&gt; [m, await db.fighters.find({ skills: m }).length]
    )
  )
)
</code></pre>
<p>But I'd really like to keep this whole thing within the aggregation framework and not use a node runtime to make this query repeatedly, and I'm completely lost as to how to do that. Of note, the set of skills is finite, but unknown, so I can't start from a known list of skills and just hardcode those into the query itself.</p>

