MongoDB $lookup on doubly nested array of objects<p>I have a data model where each <strong>product</strong> has many <strong>variants</strong> and each <strong>variant</strong> has many <strong>modifications</strong>. In the database, it looks like this:</p>
<pre class="lang-js prettyprint-override"><code>const mods = db.modifications.insertMany([
  {
    title: 'Modification #1',
    image: 'img1.png',
  },
  {
    title: 'Modification #2',
    image: 'img2.png',
  },
  {
    title: 'Modification #3',
    image: 'img3.png',
  },
])

db.products.insertOne({
  slug: 'product1',
  title: 'Product #1',
  variants: [
    {
      size: 20,
      price: 200,
      modifications: [
        { id: mods.insertedIds[0], price: 10 },
        { id: mods.insertedIds[1], price: 15 },
      ],
    },
    {
      size: 30,
      price: 250,
      modifications: [
        { id: mods.insertedIds[0], price: 15 },
        { id: mods.insertedIds[2], price: 20 },
      ],
    },
  ],
})
</code></pre>
<p><a href="https://mongoplayground.net/p/6jmEv2Q2aZO" rel="nofollow noreferrer">https://mongoplayground.net/p/6jmEv2Q2aZO</a></p>
<p>What I want is to do</p>
<pre><code>db.products.aggregate([
  { $match: { slug: 'product1' } },
  // ?
])
</code></pre>
<p>To get the result that looks like this</p>
<pre><code>{
  slug: 'product1',
  title: 'Product #1',
  variants: [
    {
      size: 20,
      price: 200,
      modifications: [
        { _id: '', title: 'Modification #1', image: '', price: 10 },
        { _id: '', title: 'Modification #2', image: '', price: 15 },
      ],
    },
    {
      size: 30,
      price: 250,
      modifications: [
        { _id: '', title: 'Modification #2', image: '', price: 15 },
        { _id: '', title: 'Modification #3', image: '', price: 20 },
      ],
    },
  ],
}
</code></pre>
<p>How to accomplish it in MongoDB?</p>
<p>I've tried to <code>$unwind</code> twice and then <code>$lookup</code></p>
<pre><code>db.products.aggregate([
  { $match: { slug: 'product1' } },
  { $unwind: '$variants' },
  { $unwind: '$variants.modifications' },
  {
    $lookup: {
      from: 'modifications',
      localField: 'variants.modifications.id',
      foreignField: '_id',
      let: { price: '$variants.modifications.price' },
      pipeline: [{ $addFields: { price: '$$price' } }],
      as: 'modifications',
    },
  },
])
</code></pre>
<p>but don't know how to <code>$group</code> (?) that data back.</p>
<p>Also, there's <a href="https://stackoverflow.com/questions/61431308/mongodb-join-on-nested-array">a similar question with the working solution</a>. In my case though, the <code>modifications</code> array isn't just an array of ids, but has data within its elements (the <code>price</code> field) which I need to include in the result somehow.</p>

