Resolve get request error caused by .populate()<p>I am trying to make a get request to  my database. I have a collection called products and another called categories. My get request contains a .populate():</p>
<pre><code>export async function GET(req: Request, { params }: Params) {
  await mongooseConnect();

  const { id } = params;

  try {
    const product = await Product.findById(id).populate(&quot;category&quot;);
    return new Response(JSON.stringify(product), { status: 200 });
  } catch (error) {
    console.log(&quot;didnt work for some reason&quot;);
    return new Response(JSON.stringify(error), { status: 500 });
  }
}
</code></pre>
<p>If I remove the .populate(&quot;category&quot;) part, the GET request works (although I only get the category ID back instead of all the fields I need for the category. When I include .populate(&quot;category&quot;), I get a 500 error. I am constantly having issues with .populate(). Thoughts on how to resolve this?</p>
<p>Here is the product model:</p>
<pre><code>const ProductSchema = new mongoose.Schema({
  name: { type: String, require: true },
  category: { type: mongoose.Types.ObjectId, ref: &quot;Category&quot; },
  description: { type: String },
  price: { type: Number, require: true },
  images: { type: [String] },
  availability: { type: Object },
});

export const Product =
  mongoose?.models?.Product || mongoose.model(&quot;Product&quot;, ProductSchema);
</code></pre>
<p>Here is the category model:</p>
<pre><code>const CategorySchema = new mongoose.Schema({
  name: { type: String, require: true },
  parentCategory: { type: mongoose.Types.ObjectId, ref: &quot;Category&quot; },
  properties: [{ type: Object }],
});

export const Category =
  mongoose?.models?.Category || mongoose.model(&quot;Category&quot;, CategorySchema);
</code></pre>

