How to properly submit, create and populate new information from my HTML to Javascript to the browser?<p>My question is, I am trying to preform a javascript function that will use a HTML prompted modal that is using an input text field and a radio button selection followed by a submit button. How can I take my commands from my modal and push the info to the back-end and then get it to display on the browser side?</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>const baseUrl       = "http://localhost:3001/"
let quotaValue      = document.getElementById('newQuota').value
let difficultyValue = document.querySelector('#difficulty2').value
const addBtn        = document.getElementById('addBtn')

const openButton  = document.querySelector('[data-open-modal]')
const closeButton = document.querySelector('#cancel')
const modal       = document.querySelector('#modal')
const outputBox   = document.querySelector('output')
const inputEl     = modal.querySelector('input')
const easyBtn     = document.querySelector('data-easy-button')
const mediumBtn   = document.querySelector('data-medium-button')
const hardBtn     = document.querySelector('data-hard-button')

const createQuotaForm = document.getElementById('create-quota-form')

// // ==== ADD-MODAL LOGIC ==== //

openButton.addEventListener('click', () =&gt; {
  modal.showModal()
})

addBtn.addEventListener('click', async(e) =&gt; {
  e.preventDefault()
  console.log('click')
  console.log(quotaValue, difficultyValue)
  try {
    const response = await axios.post(`${baseUrl}goals`, {
      title: quotaValue,
      level: difficultyValue
    })
    console.log('Goal created:', response.data)
  } catch (error) {
    console.log('Error creating goal.', error)
  }
})

addBtn.addEventListener('submit', function(e) {
  e.preventDefault()
  // modal.close(inputEl.value)
  setTimeout(function() {
    location.reload()
  }, 1000)
})

closeButton.addEventListener('click', () =&gt; {
  modal.close()
})</code></pre>
