MongoDB transactions, the callback API approach<p>Having read many doc/articles on MongoDB transactions, I still need further clarification.</p>
<p><a href="https://www.prisma.io/dataguide/mongodb/mongodb-transactions" rel="nofollow noreferrer">Here</a> it says:</p>
<blockquote>
<p>MongoDB provides two APIs to use transactions. The first is the core API which has similar syntax to relational databases. The second, the callback API, is the <em>recommended</em> approach to using transactions in MongoDB.</p>
</blockquote>
<p>Yet it went on introduced the core API approach, and did not touch the recommended approach at all.</p>
<p>The official doc <a href="https://www.mongodb.com/docs/manual/core/transactions/" rel="nofollow noreferrer">here</a> says,</p>
<blockquote>
<p>This example highlights the key components of the transactions API. In particular, it uses the callback API. The callback API:</p>
<ul>
<li>starts a transaction</li>
<li>executes the specified operations</li>
<li>commits the result (or aborts on error)</li>
</ul>
</blockquote>
<p>However, when it comes to the most important <em>&quot;executes the specified operations&quot;</em> step, the example didn't shown any relevant code. I.e., as asked in <a href="https://stackoverflow.com/questions/76201259/mongodb-transactions-in-nodejs">MongoDB Transactions In NodeJS</a>, I <em>&quot;still need a real example&quot;</em>.</p>
<p>PS. In case the example get changed or goes away, here is the Golang version:</p>
<pre class="lang-golang prettyprint-override"><code>// WithTransactionExample is an example of using the Session.WithTransaction function.
func WithTransactionExample(ctx context.Context) error {
    // For a replica set, include the replica set name and a seedlist of the members in the URI string; e.g.
    // uri := &quot;mongodb://mongodb0.example.com:27017,mongodb1.example.com:27017/?replicaSet=myRepl&quot;
    // For a sharded cluster, connect to the mongos instances; e.g.
    // uri := &quot;mongodb://mongos0.example.com:27017,mongos1.example.com:27017/&quot;
    uri := mtest.ClusterURI()
    clientOpts := options.Client().ApplyURI(uri)
    client, err := mongo.Connect(ctx, clientOpts)
    if err != nil {
        return err
    }
    defer func() { _ = client.Disconnect(ctx) }()
    // Prereq: Create collections.
    wcMajority := writeconcern.Majority()
    wcMajority.WTimeout = 1 * time.Second
    wcMajorityCollectionOpts := options.Collection().SetWriteConcern(wcMajority)
    fooColl := client.Database(&quot;mydb1&quot;).Collection(&quot;foo&quot;, wcMajorityCollectionOpts)
    barColl := client.Database(&quot;mydb1&quot;).Collection(&quot;bar&quot;, wcMajorityCollectionOpts)
    // Step 1: Define the callback that specifies the sequence of operations to perform inside the transaction.
    callback := func(sessCtx mongo.SessionContext) (interface{}, error) {
        // Important: You must pass sessCtx as the Context parameter to the operations for them to be executed in the
        // transaction.
        if _, err := fooColl.InsertOne(sessCtx, bson.D{{&quot;abc&quot;, 1}}); err != nil {
            return nil, err
        }
        if _, err := barColl.InsertOne(sessCtx, bson.D{{&quot;xyz&quot;, 999}}); err != nil {
            return nil, err
        }
        return nil, nil
    }
    // Step 2: Start a session and run the callback using WithTransaction.
    session, err := client.StartSession()
    if err != nil {
        return err
    }
    defer session.EndSession(ctx)
    result, err := session.WithTransaction(ctx, callback)
    if err != nil {
        return err
    }
    log.Printf(&quot;result: %v\n&quot;, result)
    return nil
}
</code></pre>
<p>It looks to me from the example that the most important <em>&quot;executes the specified operations&quot;</em> step is done in callback. Is that so? If so, the official doc really needs to emphasize on that.</p>

