HTTP PUT request not updating field in MongoDB<p>I am trying to make an API that can retrieve and update information inside of a database (MongoDB)
Retrieving information from said database is successful, my issue is updating the field.</p>
<p>Sending the PUT request returns 'Field replaced successfully', however whenever I make a GET request to verify that the information has been updated, it is unchanged.</p>
<p>I haven't tried many things due to a lack of understanding when it comes to Node.js
The expected result was for the field to be replaced, but after attempting to verify that the information was successfully replaced by the request's body, it was never changed. The API is made for the purpose of speeding up a task, and the code is my attempt at recreating a different API created by one of my old friends. His was near-instant.</p>
<p>The queries are as follows:</p>
<ul>
<li>key, which is required to send requests in the first place</li>
<li>id, which is the requested field to be retrieved / update</li>
</ul>
<pre><code>var Express = require(&quot;express&quot;);
var MongoClient = require(&quot;mongodb&quot;).MongoClient;
var cors = require(&quot;cors&quot;)

const multer = require(&quot;multer&quot;)

var app = Express()
app.use(cors());
app.use(Express.json());

var connection_string = &quot;connection-string&quot;
var validKey = &quot;60YGrhgU6MEz9E1UZmaMLFlAvKTbYGLGof3PRTmvAmxYWXQeeXIbjPiFhUUVaWqBc&quot;

var databaseName = &quot;data&quot;
var database;

app.listen(5038, () =&gt; {
    MongoClient.connect(connection_string, (error, client) =&gt; {
        database = client.db(databaseName);
        console.log(&quot;Connected to MongoDB&quot;)
    });
})

app.get('/api/lsbg', (request, response) =&gt; {
    const key = request.query.key;
    const id = request.query.id;

    if (key !== validKey) {
        response.status(401).send({ &quot;code&quot;: 401, &quot;error&quot;: &quot;Invalid key&quot; })
    } else {
        if (!id) {
            database.collection(&quot;giver&quot;).find({}).forEach(doc =&gt; {
                response.send(doc)
            })
        } else if (id === 0) {
            database.collection(&quot;giver&quot;).find({}).forEach(doc =&gt; {
                response.send(doc)
            })
        } else {
            database.collection('giver').findOne({}, (error, result) =&gt; {
                if (error) {
                    response.status(404).json({ &quot;code&quot;: 500, error: 'Internal server error' });
                } else if (result &amp;&amp; result.hasOwnProperty(id)) {
                    response.json(result[id]);
                } else {
                    response.status(404).json({ &quot;code&quot;: 404, error: `Could not find data of id ${id}` });
                }
            });
        }
    }
})

app.put('/api/lsbg', (req, res) =&gt; {
    const id = req.params.id;
    const updatedValue = req.body; 

    const updateQuery = { [id]: updatedValue };

    database.collection('giver').updateOne(
        {},
        { $set: updateQuery },
        (error, result) =&gt; {
            if (error) {
                res.status(500).json({ error: 'Internal server error' });
            } else {
                res.json({ message: 'Field replaced successfully' });
            }
        }
    )
});
</code></pre>
<p>EDIT: The database structure looks like this.</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;userId&quot;: {
        &quot;customs&quot;: [
            &quot;Sword&quot;,
            &quot;Spear&quot;
        ],
        &quot;morphs&quot;: [
            &quot;Knight&quot;,
            &quot;Jester&quot;
        ]
    }
}
</code></pre>

